Get list of child item ids that misses tag of parent in MongoDB<p>I want to get all items (or better ids of items) that have missing tags.</p>
<p>If a child item misses the tag of its parent it should be outputted.</p>
<p>The documents looks like this:</p>
<pre><code>[
  {
    id: 1,
    tags: [
      &quot;a&quot;,
      &quot;b&quot;
    ],
    childs: [
      2,
      3
    ]
  },
  {
    id: 2,
    tags: [
      &quot;a&quot;
    ],
    childs: []
  },
  {
    id: 3,
    tags: [],
    childs: []
  },
  {
    id: 4,
    tags: [
      &quot;c&quot;
    ],
    childs: [
      5
    ]
  },
  {
    id: 5,
    tags: [
      &quot;c&quot;
    ],
    childs: []
  },
  {
    id: 6,
    tags: [
      &quot;b&quot;
    ],
    childs: [
      5
    ]
  },
  {
    id: 7,
    tags: [],
    childs: []
  },
]
</code></pre>
<p>Now I want to search by a tag name to get items with missing tag.</p>
<p>The desired result should look like this:</p>
<p>Check for tag &quot;a&quot;:</p>
<pre><code>{
   id: 3,
   ...
}

or

{
   ids: [3]
}
</code></pre>
<p>Check for tag &quot;b&quot;:</p>
<pre><code>{
   id: 2,
   ...
},
{
   id: 3,
   ...
}

or

{
   ids: [2, 3]
}
</code></pre>
<p>I tried aggregation with the lookup and pipeline function, but did not got it working.</p>
<pre><code>[{
    $match: {
        tags: &quot;a&quot;,
        childs: {
            $ne: []
        }
    }
}, {
    $lookup: {
        from: 'collection1',
        localField: 'childs',
        foreignField: 'id',
        as: 'childs_items',
        pipeline: [{
             $matching : {
                 &quot;tags&quot;: {
                     $nin: &quot;a&quot;
                  }
             }
        }]
    }
}]
</code></pre>
<p>What would be the best approach?</p>
<p>EDIT: changed document example tags of last two docs to &quot;c&quot;
EDIT2: added example data</p>

