MongoDB aggregation: how to find common elements from two arrays of two different collections<p>Here I have two collections: users and messages. <br />
'users' has an 'user_id' field and a 'phones' <strong>array</strong> field.<br />
'messages' has a 'receiver_phones' <strong>array</strong> field.</p>
<p><code>users</code> sample</p>
<pre><code>{
  &quot;user_id&quot;: &quot;123&quot;,
  &quot;user_name&quot;: JaneDoe,
  &quot;phones&quot;: [&quot;123456&quot;, &quot;234532&quot;]
}
</code></pre>
<p><code>messages</code> sample</p>
<pre><code>{
  &quot;msg_id&quot;: &quot;678&quot;,
  &quot;sender_id&quot;: &quot;090&quot;,
  &quot;receiver_phones&quot;: [&quot;123456&quot;, &quot;000000&quot;, &quot;010342&quot;],
  &quot;content&quot;: &quot;Hello world&quot;,
  &quot;timestamp&quot;: &quot;2020-02-05&quot;
}
</code></pre>
<p>My goal is to find all messages sent to the user whose id is 123. In the case above, the result should be msg_id 678, because its <code>received_phones</code> contains one of user_123's phone numbers. <br /></p>
<p>I am trying to use $lookup to join two collections to find all messages whose 'receiver_phones' field contains any element in 'phones' of user 123. I am wondering if there is a way to find all common elements from arrays from two different collections. I am new to mongoDB and failed to write a appropriate query.</p>
<p>Here is my query</p>
<pre><code>db.messages.aggregate([{
  $lookup: {
    from: 'users',
    let: {
      receiver_phones: 'receiver_phone'
    },
    pipeline: [{
      $match: {
        $expr: {
          $and: [
            { $eq: ['$user_id', '123']},
            { '$$receiver_phones': { $elemMatch: { $in: '$phones'}}}
          ]
        }
      }
    }],
    as: 'results'
  }
}]);
</code></pre>
<p>Here is the error message:</p>
<pre><code>uncaught exception: Error: command failed: {
    &quot;ok&quot; : 0,
    &quot;errmsg&quot; : &quot;Unrecognized expression '$$receiver_phones'&quot;,
    &quot;code&quot; : 168,
    &quot;codeName&quot; : &quot;InvalidPipelineOperator&quot;
} : aggregate failed :
</code></pre>
<p>Any help is appreciated!</p>

