      { _id: &quot;item_234&quot;, type: &quot;Hoodie&quot; },
      { _id: &quot;item_345&quot;, type: &quot;Hat&quot; },
    ],
    refunds: [
      {
        _id: &quot;refund_123&quot;,
        items: [&quot;item_123&quot;, &quot;item_234&quot;],
      },
      {
        _id: &quot;refund_234&quot;,
        items: [&quot;item_345&quot;],
      },
    ],
  },
]
</code></pre>
<p>Is it possible to map <code>refunds.items</code> -&gt; <code>items._id</code>, allowing us to filter by <code>type</code>?</p>
<p>This is how we currently get the refund sub-documents:</p>
<pre><code>db.orders.aggregate([
  {
    $replaceRoot: {
      newRoot: {
        order: &quot;$$ROOT&quot;,
        refunds: &quot;$$ROOT.refunds&quot;,
      },
    },
  },
  {
    $unwind: &quot;$refunds&quot;,
  },
  {
    $project: {
      order: &quot;$order&quot;,
      refund: &quot;$refunds&quot;,
    },
  },
]);
</code></pre>
<p>Which gives us:</p>
<pre><code>// Refund documents
[
  {
    refund: {
      _id: &quot;refund_123&quot;,
      items: [&quot;item_123&quot;, &quot;item_234&quot;],
    },
    order: { ... }, // The original order document
  },
  {
    refund: {
      _id: &quot;refund_234&quot;,
      items: [&quot;item_345&quot;],
    },
    order: { ... }, // The original order document
  },
]
</code></pre>
<p>From here, we want to map up <code>refund.items</code> -&gt; <code>order.items._id</code> to produce the following output:</p>
<pre class="lang-js prettyprint-override"><code>[
  {
    _id: &quot;refund_123&quot;,
    items: [
      { _id: &quot;item_123&quot;, type: &quot;T-Shirt&quot; },
      { _id: &quot;item_234&quot;, type: &quot;Hoodie&quot; },
    ],
  },
  {
    _id: &quot;refund_234&quot;,
    items: [
      { _id: &quot;item_345&quot;, type: &quot;Hat&quot; }
    ],
  },
]
</code></pre>
<p>Allowing us to filter refund documents by <code>type</code>.</p>; Answer: @KiW Depends on the way you would be using the conditional on `z`. But that `bsxfun` part would extend to include `BML(vidx,4)`.

